import React from 'react'
import Slider from "react-slick";
import { Container, Row, Col } from 'reactstrap'
var settings = {
    dots: true,
    infinite: true,
    centerMode: true,
    centerPadding: '60px',
    arrows: false,
    autoplay: true,
    swipeToSlide: true,
    speed: 500,
    slidesToShow: 5,
    responsive: [
        {
            breakpoint: 359,
            settings: {
                slidesToShow: 1,
                centerPadding: '65px',
            }
        },
        {
            breakpoint: 1024,
            settings: {
                slidesToShow: 3
            }
        },
        {
            breakpoint: 1025,
            settings: {
                slidesToShow: 4,
            }
        }
    ]
};


const testimonial = [
    {
        img: "/assets/images/OTF/testimonial/testimonial1.png",
        title: "Client name example",
        subtitle: "Lorem ipsum dolor amit set lorem ipsum dolor amit.."
    },
    {
        img: "/assets/images/OTF/testimonial/testimonial2.png",
        title: "Client name example",
        subtitle: "Lorem ipsum dolor amit set lorem ipsum dolor amit.."
